import React , {useEffect, useState} from "react";
import AddDriver from './AddDriver';
import Address from './info/Address';
import BasicInfo from './info/BasicInfo';
import VehicleInfo from './info/VehicleInfo';
import LicenseInfo from './info/LicenseInfo';
import Documents from './info/Documents';
import { connect } from 'react-redux';
import { updateDriver } from '../../store/actions';
import { withRouter} from 'react-router-dom';

import {
    Breadcrumb,
    BreadcrumbItem,
    Button,
    Card,
    CardBody,
    CardTitle,
    Container,
    Row,
    Col,
    FormGroup,
    Input
  } from "reactstrap";

function Driver(props){
  console.log(props.driver);

	return(
    <>
      <div className="add-driver mt-5">
        <Container fluid>
          <Row>
  	        <BasicInfo/>
            <Address/>
          </Row>
          <Row>
            <VehicleInfo/>
            <Col lg="6">
              <LicenseInfo/>
              <Documents/>
            </Col>
          </Row>
        </Container>
      </div>
    </>
	);
}

const mapStatetoProps = state => {
  const driver = state.drivers;
  return driver;
}

export default withRouter(connect(mapStatetoProps, {updateDriver})(Driver));
